import React from "react";
import styled from "styled-components";


class LoginFormLinks extends React.Component {
  render() {
    return (
      <StyledLoginFormInputGroup>
        {this.props.children}
      </StyledLoginFormInputGroup>
    );
  }
}
export default LoginFormLinks;

const StyledLoginFormLinks = styled.div`
display:flex;
align-items:center;
`;
